        token: '',
    });

    const handleSubmit = (e) => {
        e.preventDefault();
        request(e, "token", formValues,setShowCreateRepo);
    }

    const handleChange = (e) => {
        change(e,setFormValues);
    }

    return (
        <div className={"form-group"}>
            <form className="forms-repo" onSubmit={handleSubmit} >
                <div className={"Content-Wrapper"}>
                    <input form={"token"} type="text" id="token" name="token" onChange={handleChange} className={"form-control"} required />
                </div>
                <div id={"wraper-elem-4"}>
                    <button type="submit" className="btn btn-primary">Submit</button>
                </div>
            </form>
        </div>
    );


}

export default Token;
